import { useState } from "react";
import GetUsersItem from "./components/GetUsersItem";

function Test() {
    function getUsers() {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then(response => response.json())
            .then(data => {
                const userItems = data.map(user => (
                    <UserItemCreator
                        key={user.id}
                        id={user.id}
                        name={user.name}
                        email={user.email}
                        phone={user.phone}
                        password={user.password}
                    />
                ));
    
                usersContainer.render(
                    <React.StrictMode>
                        <div>{userItems}</div>
                    </React.StrictMode>
                );
            })
            .catch(error => {
                console.error('Error:', error);
            });
    }
    
    getUsers();



    const [userItems, setUserItems] = useState([
        {id: 1, name: 'Nazir', email: 'nazik@nosex.ru', phone: '78076002213', password: 'genshinimba2010'},
        {id: 2, name: 'MEV', email: 'Mevbx@sigma.ru', phone: '7**********', password: '************'},
    ])



    return (
        <div className="App">
            {userItems.map(item => 
                <GetUsersItem item={item} key={item.id} />
            )}
            
        </div>
    )
}

export default Test
